import React from 'react';
import type { FunctionComponent } from 'react';
import Logojpeg from '../../Assets/Images/fontys.jpeg';

interface LogoProps {
    width?: number;
    height?: number;
}

const Logo: FunctionComponent<LogoProps> = ({
    width = 100,
    height = 100
}) => {
    return (
        <div>
        <img src={Logojpeg} alt="Logo" style={{ height: height, width: width }} />
      </div>
    );
};

export default Logo;
